import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';
/** @jsx jsx */
/** @jsxFrag React.Fragment */
import { jsx, css, keyframes } from '@emotion/core';

export default function App() {
  const header = css`
    width: 100%;
    background-color: #4abdac;
  `;
  const img = css`
    width: 500px;
    margin-left: auto;
    margin-right: auto;
    display: block;
    padding-top: 50px;
    padding-bottom: 50px;
    margin-top: 30px;
  `;

  const quote = css`
    text-align: center;
    font-size: 1.5rem;
    font-family: 'Karla', sans-serif;
    margin-top: 60px;
    color: #555555;
  `;

  ////////////////////
  // body {
  //   width: 100%;
  //   height: 100%;
  //   position: fixed;
  //   background-color: #34495e;
  // }

  const content = css`
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    height: 160px;
    overflow: hidden;

    font-family: 'Lato', sans-serif;
    font-size: 35px;
    line-height: 40px;
    color: #ecf0f1;
  `;

  const contentContainer = css`
    font-weight: 600;
    overflow: hidden;
    height: 40px;
    padding: 0 40px;

    :before & {
      content: '[';
      left: 0;
    }

    :after & {
      content: ']';
      position: absolute;
      right: 0;
    }

    :after &,
    :before & {
      position: absolute;
      top: 0;

      color: #16a085;
      font-size: 42px;
      line-height: 40px;

      -webkit-animation-name: opacity;
      -webkit-animation-duration: 2s;
      -webkit-animation-iteration-count: infinite;
      animation-name: opacity;
      animation-duration: 2s;
      animation-iteration-count: infinite;
    }
  `;

  const text = css`
    display: inline;
    ${'' /* float: left; */}
    margin: 0;
  `;

  const list = css`
    margin-top: 0;
    padding-left: 110px;
    text-align: left;
    list-style: none;

    -webkit-animation-name: change;
    -webkit-animation-duration: 10s;
    -webkit-animation-iteration-count: infinite;
    animation-name: change;
    animation-duration: 10s;
    animation-iteration-count: infinite;
  `;

  const item = css`
    line-height: 40px;
    margin: 0;
  `;

  const keys = keyframes`
    @-webkit-keyframes opacity {
      0%, 100% {opacity:0;}
      50% {opacity:1;}
    }

    @-webkit-keyframes change {
      0%, 12.66%, 100% {transform:translate3d(0,0,0);}
      16.66%, 29.32% {transform:translate3d(0,-25%,0);}
      33.32%,45.98% {transform:translate3d(0,-50%,0);}
      49.98%,62.64% {transform:translate3d(0,-75%,0);}
      66.64%,79.3% {transform:translate3d(0,-50%,0);}
      83.3%,95.96% {transform:translate3d(0,-25%,0);}
    }

    @-o-keyframes opacity {
      0%, 100% {opacity:0;}
      50% {opacity:1;}
    }

    @-o-keyframes change {
      0%, 12.66%, 100% {transform:translate3d(0,0,0);}
      16.66%, 29.32% {transform:translate3d(0,-25%,0);}
      33.32%,45.98% {transform:translate3d(0,-50%,0);}
      49.98%,62.64% {transform:translate3d(0,-75%,0);}
      66.64%,79.3% {transform:translate3d(0,-50%,0);}
      83.3%,95.96% {transform:translate3d(0,-25%,0);}
    }

    @-moz-keyframes opacity {
      0%, 100% {opacity:0;}
      50% {opacity:1;}
    }

    @-moz-keyframes change {
      0%, 12.66%, 100% {transform:translate3d(0,0,0);}
      16.66%, 29.32% {transform:translate3d(0,-25%,0);}
      33.32%,45.98% {transform:translate3d(0,-50%,0);}
      49.98%,62.64% {transform:translate3d(0,-75%,0);}
      66.64%,79.3% {transform:translate3d(0,-50%,0);}
      83.3%,95.96% {transform:translate3d(0,-25%,0);}
    }

    @keyframes opacity {
      0%, 100% {opacity:0;}
      50% {opacity:1;}
    }

    @keyframes change {
      0%, 12.66%, 100% {transform:translate3d(0,0,0);}
      16.66%, 29.32% {transform:translate3d(0,-25%,0);}
      33.32%,45.98% {transform:translate3d(0,-50%,0);}
      49.98%,62.64% {transform:translate3d(0,-75%,0);}
      66.64%,79.3% {transform:translate3d(0,-50%,0);}
      83.3%,95.96% {transform:translate3d(0,-25%,0);}
    }
  `;

  return (
    <div>
      <style>
        @import
        url('https://fonts.googleapis.com/css2?family=Karla:wght@400;700&display=swap');
      </style>
      <Header />
      <div css={header}>
        <img src="/wien.png" alt="vienna city" css={img} />
      </div>
      <div>
        <p css={quote}>Get your personalized plan based on your interests!</p>
      </div>
      <link
        href="https://fonts.googleapis.com/css?family=Lato"
        rel="stylesheet"
      />

      <div css={content}>
        <div css={contentContainer}>
          <p css={text}>Hello</p>

          <ul class="content__container__list">
            <li class={item}>world !</li>
            <li class={item}>bob !</li>
            <li class={item}>users !</li>
            <li class={item}>everybody !</li>
          </ul>
        </div>
      </div>
      <Footer />
    </div>
  );
}
